 200 :WIDTH 250)\n;;; Restore if wanted\n(hc/update-defaults :HEIGHT (first prevhw) :WIDTH (last prevhw))\n\n\n;;; **************************************************************************\n;;; OK, NOTE, IF YOU WANT TO FOLLOW ALONG MAKING THE ELEMENTS ACCORDING TO THE\n;;; RUNNING COMMENTARY IN THE COMMENTS, YOU WILL FIRST WANT TO REMOVE ALL THE\n;;; PICFRAMES. THE EASIEST AND QUICKEST WAY TO DO THAT IS TO CLICK THE\n;;; \"Delete Frames\" button (dark with '-' inside). Select F2 through F15. DO\n;;; NOT SELECT F1 or F1b!! Click the 'check'/OK button. F2 through F15 will be\n;;; removed.\n;;; **************************************************************************\n\n\n;;; We are in row ording here with 2 elements (picframes) per row.\n;;; So every 2 in the following are a row.\n\n;;;The first two are pretty boring - you've seen them before\n(hc/xform\n ht/layer-chart :FID :f2 :VID :v2\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"100px\"]\n         [md {:style {:font-size \"16px\"}}\n          \"Layers - scatter with opacity 0.3; smoothed trend lines\"]]\n :UDATA \"data/cars.json\"\n :LAYER [(hc/xform\n          ht/point-chart :FID :f2 :VID :v2 :OPACITY 0.3\n          :X \"Horsepower\" :Y \"Miles_per_Gallon\" :COLOR \"Origin\")\n         (hc/xform\n          ht/line-chart :XBIN true :YAGG :mean\n          :X \"Horsepower\" :Y \"Miles_per_Gallon\" :COLOR \"Origin\")])\n\n\n(hc/xform\n ht/line-chart :FID :f3 :VID :v3\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"100px\"]\n         [md {:style {:font-size \"16px\"}}\n          \"Smoothed faceted line plot\"]]\n :UDATA \"data/cars.json\" :XBIN true :YAGG :mean\n :HEIGHT 200 :WIDTH 250\n :X \"Horsepower\" :Y \"Miles_per_Gallon\" \n :COLOR \"Origin\" ;:SHAPE \"Origin\" \n :COLDEF {:field \"Origin\"})\n\n\n\n\n;;; Slightly more interesting since it uses a Vega template\n;;; Note :MODE...\n(hc/xform\n ht/contour-plot :MODE \"vega\" :FID :f4 :VID :v4\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"100px\"]\n         [md {:style {:font-size \"16px\"}}\n          \"Contour plot - notice: **mode** is Vega\"]]\n ;:HEIGHT 400, :WIDTH 500\n :X \"Horsepower\", :XTITLE \"Engine Horsepower\"\n :Y \"Miles_per_Gallon\" :YTITLE \"Miles/Gallon\"\n :UDATA \"data/cars.json\"\n :XFORM-EXPR #(let [d1 (% :X)\n                    d2 (% :Y)]\n                (format \"datum['%s'] != null && datum['%s'] !=null\" d1 d2)))\n\n\n;;; For this next one, we need to run some code.\n;;; First, run this on the JVM to define it there!\n;;; Place cursor somewhere in the code and use Ctrl-X-Ctrl-J\n;;; (Run outer sexpr on JVM. This is like cider Ctrl-C Ctrl-C execute outer\n;;; sexpression)\n;;; Normally, this sort of stuff would be in a separate 'code' tab\n(defn roundit [r & {:keys [places] :or {places 4}}]\n  (let [n (Math/pow 10.0 places)]\n    (-> r (* n) Math/round (/ n))))\n\n;;; OK, you can now run this with Ctrl-X-Ctrl-C. It will perform computation\n;;; On the JVM and set the _client_ var `data` to the result\n;;; Again, this would likely be in the same separate 'code' tab\n(def data (clj (->> (range 0.001 100.0 0.1)\n                 (mapv #(do {:x (roundit %)\n                             :y (-> % Math/sqrt roundit)})))))\n(count data) ; Put cursor at right paren and Ctrl-X-Ctrl-E to get count\n\n;;; OK, now we can vis this with some LaTex - use Ctrl-X Ctrl-I (or Insert)\n(hc/xform\n ht/line-chart :FID :f5 :VID :v5\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"200px\"]\n         [p {:style {:font-size \"16px\"}}\n          \"Simple plot with LaTex: \\\\(f(x) = \\\\sqrt x\\\\)\"]]\n :DATA data)\n\n\n\n\n;;; The next two are area charts. Both are basically from the VGL gallery\n;;; But here we do them with some of the out-of-box templates\n(hc/xform\n ht/vconcat-chart :FID :f6 :VID :v6\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"100px\"]\n         [md {:style {:width \"600px\":font-size \"16px\"}}\n          \"Simple Overview + Detail example. Left mouse down in lower for brush\"]]\n :UDATA \"data/sp500.csv\",\n :VCONCAT \n [(hc/xform\n   ht/area-chart :WIDTH 500 :HEIGHT 200\n   :X :date, :Y :price :XTYPE :temporal, :XSCALE {:domain {:selection :brush}})\n  (hc/xform\n   ht/area-chart :WIDTH 500 :HEIGHT 60,\n   :SELECTION {:brush {:type :interval, :encodings [:x]}},\n   :X :date :XTYPE :temporal\n   :Y :price, :YAXIS {:tickCount 3, :grid false})])\n\n\n(hc/xform\n ht/area-chart :FID :f7 :VID :v7\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"100px\"]\n         [md {:style {:font-size \"16px\"}}\n          \"Simple area chart using series color scheme\"]]\n :UDATA  \"data/unemployment-across-industries.json\"\n :TOOLTIP RMV\n :X :date, :XTYPE :temporal, :XUNIT :yearmonth, :XFORMAT \"%Y\"\n :Y \"count\" :AGG \"sum\"\n :COLOR {:field \"series\", :type \"nominal\",\n         :scale {:scheme \"category20b\"}})\n\n\n\n\n;;; For the next two, we build a couple 'geo-templates'. So, this is also a bit\n;;; of an example of how to go about makeing a new vis abstraction with the\n;;; template system. The first is better than the second, but both could use\n;;; more abstraction.\n;;;\n;;; Need geo-encoding which is quite different from default encoding. Do this\n;;; by adding some new default substitution keys.\n(hc/update-defaults\n :GTTFIELD \"name\" :GTTTYPE \"nominal\"\n :PROJECTION {:type \"albersUsa\"}\n :GEOENCODING\n {:longitude {:field \"longitude\", :type \"quantitative\"},\n  :latitude {:field \"latitude\", :type \"quantitative\"},\n  :tooltip [{:field :GTTFIELD, :type :GTTTYPE}\n            {:field \"longitude\", :type \"quantitative\"}\n            {:field \"latitude\", :type \"quantitative\"}],\n  :size :SIZE})\n;;; Define the template, note we override std encoding in view-base\n(def geo-chart\n  (assoc ht/view-base :mark \"circle\" :projection :PROJECTION\n         :encoding :GEOENCODING\n         :config {:view {:stroke \"transparent\"}}))\n\n(hc/xform\n geo-chart :FID :f8 :VID :v8\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"100px\"]\n         [md {:style {:font-size \"16px\"}}\n          \"Geo chart using new geo template (see code)\"]]\n :SIZE {:value 10} :HEIGHT 300 :WIDTH 500\n :UDATA \"data/airports.csv\")\n\n\n;;; Vars for some global urls...\n;;; Put cursor at right paren and 'Ctrl-X Ctrl-E' them...\n(def vgdata-base\n  \"https://raw.githubusercontent.com/vega/vega-datasets/master/data/\")\n(def us-10m (str vgdata-base \"us-10m.json\"))\n(def unemployment (str vgdata-base \"unemployment.tsv\"))\n\n;;; Not a very good template - needs more and better abstraction...\n(def geo-choro\n  (assoc ht/view-base :mark \"geoshape\" :projection :PROJECTION))\n;;; Using the geo-choro hack....\n;;; In particular, the 'transform' here needs to be abstracted. The 'raw'\n;;; VGL form is _really_ easy to mess up!!!\n(hc/xform\n geo-choro :FID :f9 :VID :v9\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"100px\"]\n         [md {:style {:font-size \"16px\"}}\n          \"Geo chart using geo-choro template (see code)\"]]\n :UDATA us-10m :DFMT {:type \"topojson\", :feature \"counties\"}\n :WIDTH 500 :HEIGHT 300\n :TRANSFORM [{:lookup \"id\"\n              :from {:data {:url unemployment} :key \"id\", :fields [\"rate\"]}}]\n :ENCODING {:color {:field \"rate\", :type \"quantitative\"}})\n\n\n\n\n;;; In the next two, we mix server side computation with client side rendering\n;;; of the computation result.\n;;;\n;;; Use Ctrl-X Ctrl-C to execute the actual form; results in output area\n;;;\n;;; Use Ctrl-X Ctrl-I or Insert to insert the vis of that computation\n;;; Use Ctrl-X Ctrl-D or Delete to remove vis\n(hc/xform\n ht/layer-chart :FID :f10 :VID :v10\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"100px\"]\n         [p {:style {:font-size \"16px\"}}\n          \"SI: \\\\(I(X) = -logP(X) = log(\\\\frac {1} {p})= -log(p)\\\\)\"]]\n :TITLE \"Self Information (unexpectedness)\"\n :LAYER [(hc/xform ht/xrule-layer :AGG \"mean\")\n         (hc/xform ht/line-layer\n                   :XTITLE \"Probability of event\"\n                   :YTITLE \"-log(p)\")]\n :DATA (clj (->> (range 0.005 0.999 0.001)\n              (mapv (fn[p] {:x p, :y (- (m/log2 p)) :col \"SI\"})))))\n\n(hc/xform\n ht/layer-chart :FID :f11 :VID :v11\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"100px\"]\n         [p {:style {:width \"600px\" :font-size \"16px\"}}\n          \"Entropy: \\\\(H(X) = E[I(X)] = E[-log P(X)] = -\\\\sum\\\\limits_{i=1}^n P(x_i) log P(x_i)\\\\)\"]]\n :TITLE \"Entropy (Unpredictability)\"\n :LAYER [(hc/xform ht/gen-encode-layer\n                   :MARK \"line\"\n                   :XTITLE \"Probability of event\" :YTITLE \"H(p)\")\n         (hc/xform ht/xrule-layer :AGG \"mean\")]\n :DATA (clj (->> (range 0.00005 0.9999 0.001)\n              (mapv (fn[p] {:x p,\n                            :y (- (- (* p (m/log2 p)))\n                                  (* (- 1 p) (m/log2 (- 1 p))))})))))\n\n\n\n\n;;; Run this on server and set _client_ obsdist to the same value. So, both\n;;; the server and the client (in this namespace) have var `obsdist` defined.\n;;; This will be our supposed 'real observed' distribution in the following\n;;; Use Ctrl-X Ctrl-C\n(def obsdist\n  (clj (deref\n        (def obsdist\n          (let [obs [[0 9] [1 78] [2 305] [3 752] [4 1150] [5 1166]\n                     [6 899] [7 460] [8 644] [9 533] [10 504]]\n                totcnt (->> obs (mapv second) (apply +))\n                pdist (map (fn[[k cnt]] [k (double (/ cnt totcnt))]) obs)]\n            pdist)))))\n\n\n;;; These two show how you can use relative entropy to zero in on a\n;;; correct (binomial) model of an observed distribution\n(hc/xform\n ht/line-chart :FID :f12 :VID :v12\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"150px\"]\n         [p {:style {:width \"600px\" :font-size \"16px\"}}\n          \"\\\\(KLD(P \\\\Vert Q) = \\\\sum\\\\limits_{x \\\\in X} P(x) log \\\\frac {Q(x)}{P(x)}\\\\)\"]]\n :POINT true\n :TITLE \"KLD minimum entropy: True P to Binomial Q estimate\"\n :XTITLE \"Binomial Distribution P paramter\"\n :YTITLE \"KLD(P||Q)\"\n :DATA (clj (mapv #(let [RE (it/KLD (->> obsdist (into {}))\n                                    (->> (p/binomial-dist 10 %)\n                                      (into {})))\n                         REtt (roundit RE)\n                         ptt (roundit % :places 2)]\n                     {:x % :y RE})\n                  (range 0.06 0.98 0.01))))\n\n(hc/xform\n ht/line-chart :FID :f13 :VID :v13\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"100px\"]\n         [p {:style {:width \"600px\" :font-size \"16px\"}}\n          \"\\\\(JSD(P \\\\Vert Q) = \\\\frac{1}{2} KLD(P \\\\Vert M) + \\\\frac{1}{2} KLD(Q \\\\Vert M), M = \\\\frac{1}{2}(P + Q) \\\\)\"]]\n :POINT true\n :TITLE \"JSD minimum entropy: True P to Binomial Q estimate\"\n :XTITLE \"Binomial Distribution P paramter\"\n :YTITLE \"JSD(P||Q)\"\n :DATA (clj (mapv #(let [RE (it/jensen-shannon\n                             (->> obsdist (into {}))\n                             (->> (p/binomial-dist 10 %)\n                               (into {})))\n                         REtt (roundit RE)\n                         ptt (roundit % :places 2)]\n                     {:x % :y RE})\n                  (range 0.06 0.98 0.01))))\n\n\n\n;;; That's nice, but neither of those is a true metric. JSD is close as it is\n;;; symmetric and positive-definite. It's also nicely bounded [0,1] when base\n;;; 2 log is used. But it doesn't satisfy the triangle property.\n;;; However, not too long ago, two independent researchers showed that the\n;;; sqrt(JSD) is a metric. That's amazingly useful as this version can be\n;;; used for true distances - for example in metric trees\n(hc/xform\n ht/line-chart :FID :f14 :VID :v14\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"150px\"]\n         [p {:style {:width \"600px\" :font-size \"16px\"}}\n          \"\\\\(\\\\sqrt{JSD(P \\\\Vert Q)}\\\\), a relative entropy based metric\"]]\n :POINT true\n :TITLE \"SQRT(JSD) minimum entropy: True P to Binomial Q estimate\"\n :XTITLE \"Binomial Distribution P paramter\"\n :YTITLE \"JSD(P||Q)\"\n :DATA (clj (mapv #(let [RE (Math/sqrt\n                             (it/jensen-shannon\n                              (->> obsdist (into {}))\n                              (->> (p/binomial-dist 10 %)\n                                (into {}))))\n                         REtt (roundit RE)\n                         ptt (roundit % :places 2)]\n                     {:x % :y RE})\n                  (range 0.06 0.98 0.01))))\n\n;;; Use Ctrl-X J at right paren\n(def JSD it/jensen-shannon)\n;;; Use Ctrl-X Ctrl-C : execute on JVM bind to client `mixed-data`\n(def mixed-data\n  (clj (concat\n             (mapv #(let [RE (it/KLD (->> obsdist (into {}))\n                                     (->> (p/binomial-dist 10 %)\n                                          (into {})))]\n                      {:x % :y RE :RE \"KLD\"})\n                   (range 0.06 0.98 0.01))\n             (mapv #(let [RE (Math/sqrt (JSD (->> obsdist (into {}))\n                                             (->> (p/binomial-dist 10 %)\n                                               (into {}))))]\n                      {:x % :y RE :RE \"JSD\"})\n                   (range 0.06 0.98 0.01)))))\n\n\n;;; Interactive layer plot with both KLD and Sqrt(JSD)\n(hc/xform\n ht/layer-chart :FID :f15 :VID :v15\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"150px\"]\n         [p {:style {:width \"500px\" :font-size \"16px\"}}\n          \"\\\\(\\\\sqrt{JSD(P \\\\Vert Q)}\\\\) and \\\\(KLD(P \\\\Vert Q)\\\\). Zoom with mouse wheel. Pan with shift-left-mouse\"]]\n :TITLE \"Minimum entropy: True P to Binomial Q estimate\"\n :DATA mixed-data\n :LAYER [(hc/xform ht/line-chart\n                   :POINT true\n                   :TRANSFORM [{:filter {:field \"RE\" :equal \"KLD\"}}]\n                   :SELECTION ht/interval-scales :INAME \"grid1\"\n                   :COLOR {:field \"RE\" :type \"nominal\"\n                           :legend {:type \"symbol\" :offset 0 :title \"RE\"}}\n                   :XTITLE \"Binomial Distribution P paramter\"\n                   :YTITLE \"KLD(P||Q)\")\n         (hc/xform ht/line-chart\n                   :POINT true\n                   :TRANSFORM [{:filter {:field \"RE\" :equal \"JSD\"}}]\n                   :SELECTION ht/interval-scales :INAME \"grid2\"\n                   :COLOR {:field \"RE\" :type \"nominal\"\n                           :legend {:type \"symbol\" :offset 0 :title \"RE\"}}\n                   :XTITLE \"Binomial Distribution P paramter\"\n                   :YTITLE \"Sqrt(JSD(P||Q))\")]\n :RESOLVE {:scale {\"y\" \"independent\"}})\n\n\n\n\n;;; This last one is another Vega plot. But it is so large that it is not\n;;; paired with another in the same row....\n(hc/xform\n ht/tree-layout :MODE \"vega\" :FID :f99 :VID :v99\n :LEFT '[[p {:style {:width \"100px\":min-width \"100px\"}}]]\n :TOP '[[gap :size \"100px\"]\n         [md {:style {:font-size \"16px\"}}\n          \"Another Vega plot, this time showing tree layout\"]]\n :WIDTH 650, :HEIGHT 1600\n :UDATA\n \"https://raw.githubusercontent.com/vega/vega-datasets/master/data/flare.json\"\n :LINKSHAPE \"diagonal\" :LAYOUT \"tidy\" :FONTSIZE 11\n :CFIELD \"depth\")\n\n", :out-height "100px", :eid "ed-gallery", :height "700px"}}, :specs [{:usermeta {:frame {:pos :after, :at :end, :fid :f1, :left [[gap :size "100px"] [md {:style {:font-size "25px", :width 900}} "\n# A Gallery of various visualizations and MD / LaTex\n  Open the editor pane to see code and/or mess with it\n"]]}, :session-name "Exploring", :opts {:mode "vega-lite", :source false, :export {:png true, :svg true}, :renderer "canvas", :scaleFactor 1, :editor true}, :msgop :tabs, :tab {:label "Expl1", :id :expl1, :opts {:eltsper 2, :size "auto", :order :row}}}} {:usermeta {:frame {:pos :after, :at :end, :fid :f1b, :left [[gap :size "100px"] [md {:style {:font-size "25px", :width 900}} ""]]}, :session-name "Exploring", :opts {:mode "vega-lite", :source false, :export {:png true, :svg true}, :renderer "canvas", :scaleFactor 1, :editor true}, :msgop :tabs, :tab {:label "Expl1", :id :expl1, :opts {:eltsper 2, :size "auto", :order :row}}}} {:usermeta {:frame {:top [[gap :size "100px"] [md {:style {:font-size "16px"}} "Layers - scatter with opacity 0.3; smoothed trend lines"]], :pos :after, :at :end, :fid :f2, :left [[p {:style {:min-width "100px", :width "100px"}}]]}, :vid :v2, :session-name "Exploring", :opts {:mode "vega-lite", :source false, :export {:png true, :svg true}, :renderer "canvas", :scaleFactor 1, :editor true}, :msgop :tabs, :tab {:label "Gallery", :id :gallery, :opts {:eltsper 2, :size "auto", :rgap "20px", :cgap "20px", :order :row}}}, :config {:bar {:discreteBandSize 5, :binSpacing 1, :continuousBandSize 5}}, :width 400, :background "floralwhite", :layer [{:encoding {:y {:field "Miles_per_Gallon", :type "quantitative"}, :color {:field "Origin", :type "nominal"}, :opacity {:value 0.3}, :x {:field "Horsepower", :type "quantitative"}, :tooltip [{:field "Horsepower", :type "quantitative"} {:field "Miles_per_Gallon", :type "quantitative"}]}, :usermeta {:frame {:pos :after, :at :end, :fid :f2}, :vid :v2, :session-name "Exploring", :opts {:mode "vega-lite", :source false, :export {:png true, :svg true}, :renderer "canvas", :scaleFactor 1, :editor true}, :msgop :tabs, :tab {:label "Gallery", :id :gallery, :opts {:eltsper 2, :size "auto", :rgap "20px", :cgap "20px", :order :row}}}, :mark {:type "circle"},